import React from 'react';
import classes from './Publish_posts.module.css';


const Publish_Posts = () => {
	return <div className={classes.published_posts}>

	
			<div className={classes.post}><div className={classes.circle}></div>post 1</div>
			<div className={classes.post}><div className={classes.circle}></div>post 2</div>
			<div className={classes.post}><div className={classes.circle}></div>post 3</div>
		
	</div>
}

export default  Publish_Posts
